B.Dj=new A.cV("Infrastructure Management","Let\u2019s boost and maintain your infrastructure so you can focus on what matters to your core business. R-CUBED manages your environments and systems whether in the cloud, on premise, or blended. We specialize in enterprise applications and integration platforms. We cover end-to-end infrastructure management: administration, monitoring &amp; maintenance. ",null)
B.Dk=new A.cV("Applications Management","R-CUBED manages your application portfolio so you can shift focus to more strategic initiatives. We thrive on keeping business operating and optimized 24x7x365. Our delivery method is fit to your specific needs whether on-shore, off-shore, or blended. We specialize in enterprise applications and integration platforms covering administration, functional support &amp; development. ",null)
B.Dl=new A.cV("Data Availability & Analytics","R-CUBED constructs an architecture that enables enterprise analytic platforms by having ready access to quality data. Ready access to data and data quality is essential to adjust strategy and remain competitive in your ever-evolving market. This data foundation allows business to make better, faster, data-driven decisions and flex to market changes.",null)
B.Dm=new A.cV("Enterprise Resource Planning","R-CUBED is a change catalyst to the way people work through digital enablement driving efficiency, data accessibility, performance improvement, and adoption today and beyond. Our agile, value-focused, and \u2018Client In\u2019 methodology helps you re-envision the achievable for your enterprise application portfolio and realize operational potential.",null)
B.Dn=new A.cV("Support & Change Management","R-CUBED prioritizes integration adoption through continuous knowledge transfer of the \u2018know how\u2019 to sustain and scale. R-CUBED takes pride in its ability to prepare teams for success in the new paradigm.",null)
B.Do=new A.cV("Cloud Readiness Assessment","Let R-CUBED assess and size the value to move to the cloud. Security, unstructured data, and performance of IT operations are the top drivers to migrate to the cloud. R-CUBED will baseline your current IT environment and resources. We will build an insightful value proposition with cloud model considerations (SaaS, PaaS, IaaS, &/or blended) and decision path options & impacts giving you the confidence to take the cloud journey.",null)
B.Dp=new A.cV("Strategy & Road-Map","R-CUBED helps organizations develop an integration strategy that drives business transformation with organizational flexibility to quickly respond to evolving market demands.An integration strategy is a \u2018must have\u2019 in today\u2019s continuous disruption and pace of change.R-CUBED will team with you to create a time-phased integration roadmap to fuel your digital transformation journey.",null)
B.Dq=new A.cV("Quality Management","Don\u2019t let resource contention delay you from keeping up to date with the latest software releases. Tap into  R-CUBED\u2019s domain experts to manage, execute, and harmonize your quality assurance process. Our agile, automated, risk-based approach and quality assurance framework yields shorter test release cycles while achieving higher quality standards giving you the confidence you need to keep current with evolving technology capability. We specialize in pre &amp; post implementation assessment, system test strategy &amp; plan, and test script creation &amp; execution covering enterprise application and integration platforms. ",null)
B.Dr=new A.cV("Development & Implementation","R-CUBED unleashes business performance by building and implementing integration solutions that lay the foundation for business services. Our proprietary and agile methods deliver digital enablement that is core in achieving quality, completeness, and responsiveness to business needs.",null)
B.Ds=new A.cV("Master Data Governance","R-CUBED supports organizations in cleansing historical data through classification &amp; enrichment methods and helps manage on-going data quality using our comprehensive data governance model. Managed and governed master data is vital to unified transactional efficiency. It establishes your basis for complete &amp; consistent data improving automation, enhancing data accuracy, increasing systemic controls, and enabling analytical insights.",null)
B.Dt=new A.cV("Cloud Enablement","Team with R-CUBED to move to the cloud.  Our agile, value-focused method helps you move to a cloud solution \u2013 whether that be from your on-premise environment to the cloud or a net new cloud platform. Let\u2019s help you execute a smooth migration to the cloud with timely stage gates to manage progress, mitigate risk, and modernize your way of working.  We know how to enable cloud success.",null)
B.Du=new A.cV("Diagnostic & Assessment","R-CUBED will work with you to build a value proposition for \u2018first-in-class\u2019 integration frameworks, platforms, and processes that ignite digital transformation today & flex for the future. We will baseline your current integration landscape and position options for modernization that are fit for purpose with your strategy and business initiatives.",null)
B.Dv=new A.cV("System Select","Whether you are closing the gap of technical debt, unifying your transaction processing & master data to leverage your data as an asset, or looking to maximize your IT investment, R-CUBED enables you to select the right fit-for-purpose solutions. We specialize in business ready applications across Enterprise Resource Planning, Corporate Performance Management, Enterprise Analytics, and Human Capital Management.",null)
B.Dw=new A.cV("Enterprise Analytics","R-CUBED delivers real data-driven enterprise decision capability using holistic analytic strategies and resilient architecture. We help you deploy an agile analytics model to make well informed data-backed decisions that strengthen business results. We specialize in Human Capital Management, Supply Chain Management and Finance Analytics.",null)
B.Dx=new A.cV("Operations Management","R-CUBED puts the user experience at the center of our unified support delivery model. We measure our success on user experience. R-CUBED is proactively responsive, attentive to priority, and mindful of cycle times throughout the service request lifecycle. We are seasoned domain and product experts offering 24x7x365 service.",null)
B.Dy=new A.cV("System Diagnostic Strategy","Let R-CUBED baseline your current application landscape and position opportunities and considerations for modernization. We will team with you to develop a business case and time-phased strategic roadmap to migrate and/or enhance your enterprise application footprint aligning to operational strategy and initiatives.",null)
